import React from "react";

function List({ list }) {
  const stuff = {
    name: "Blackbird",
    id: 1,
    created_at: "2021-05-19",
    items: [
      {
        name: "Buy milk",
        id: 1,
        importance: 1
      },
      {
        name: "Buy eggs",
        id: 2,
        importance: 2
      },
      {
        name: "Buy bread",
        id: 3,
        importance: 3
      }
    ]
  };

  return (
    <div>
      <h1>{list.name}</h1>
      <p>{list.created_at}</p>
      <ul>
        {list.items.map(item => (
          <li key={item.id}>
            <span>{item.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default List;
